import Button from 'react-bootstrap/Button'
import Form from 'react-bootstrap/Form'

function ContactForm() {
  return (
    <form className='bg-light text-dark p-5 border shadow'>
        <div className="row">
            <Form.Group></Form.Group>
        </div>
    </form>
  )
}

export default ContactForm
